    full time employee, the Executive Director, whose time is more than 25 percent
    devoted to federal elections and candidates.  Disbursements for salary, health
    benefits, and taxes of the Executive Director are reported on Schedule B supporting
    line 30(b) of this report. No other entity pays compensation for their employees
    to work for the committee.  The Committee does not engage in any fundraising on
    behalf of candidates for Federal office, so all of its reported fundraising expenses
    are party fundraising. The Committee maintains both Federal and Non Federal accounts.
